      content: >2-

                    To the person who was responsible for reconstruc-
                ting this timeless relic, [bolditalic]what the fuck?[/bolditalic]

                        I have worked for [bold]EONS[/bold] in the
                Nyanotrasen Sector Io, and this looks NOTHING alike.
                It's too short! It has gas miners, for crying out loud!
                And I sure as hell [italic]DIDN'T PAY FOR THAT.[/italic]

                        Oh, my, if Kait McCoy saw this she'd be ALL OVER
                you with the legal might of the Shuttlecrafting code.
                Because, according to it, [italic]thou must not tamper.[/italic] And what
                do I get? Some shitty Solarian knockoff of [bold]the[/bold] Nomad.
                Guys!! It's not that hard to build a shuttle that debuted
                what, two years ago? I mean, at least you got the atmos
                right, but FUCK YOU!

                    Memory be damned,
                    with best regards,
                        [bold]Zed Seven[/bold]
              Chief of Atmospherics
                     Sector NX-441
